import styled from "styled-components";

const MyButton = styled.div`
  border-radius: 8px;
  box-shadow: -4px 5px 5px 5px #00000070;
  padding: 2px 10px;
  width: fit-content;
  height: 20px;
  margin-top: 5px;
`;

const Button = (props: { text: string }) => {
  return <MyButton>{props.text}</MyButton>;
};

export default Button;
